import React from "react";
import { Nav, Navbar } from "react-bootstrap";
import '../App.css';

export const NavBar = () => (
  <Navbar className="navbar" expand="lg">
    <Navbar.Brand href="/">
      <i className="fa fa-plane"></i><div className="brand-name">AeroInfo</div>
    </Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="mr-auto">
        <Nav.Link className="link" href="/"> Home    </Nav.Link>
        <Nav.Link className="link" href="/aircrafts"> Aircrafts    </Nav.Link>
        <Nav.Link className="link" href="/airlines"> Airlines </Nav.Link>
        <Nav.Link className="link" href="/airports"> Airports </Nav.Link>
        <Nav.Link className="link" href="/about"> About </Nav.Link>
      </Nav>
    </Navbar.Collapse>
  </Navbar>
);
